import React from 'react'
import {Button} from "semantic-ui-react"

const Quote = () => {
    return (
        <div>
            <h3>"Life is great. You got this!"</h3>
            <Link to="/">Manage Quotes</Link>
            <Link to="/weights">Chart Button</Link>
            <Link to="/weights/new">Add Weight</Link>
        </div>
    )
}

export default Quote
